ggControllers.controller('nlw', ['$scope', '$rootScope', '$element', '$timeout', '$http', 'ggActiveList', 'ggProStatus', 'ggNLW', 
function($scope, $rootScope, $element, $timeout, $http, ggActiveList, ggProStatus, ggNLW) {
    
    $scope.activeTheme="cabin";
    $scope.gzFrame;
    $scope.showHelp = false;
    $scope.dummyphoto = "";
    $scope.canvasHeight = 1024;
    $scope.canvasWidth = 1024;
    $scope.canvasMarginTop = -($element[0].clientWidth*1.06);
    $scope.canvasMarginLeft = ($element[0].clientWidth*0.03);
    $scope.canvasScale = ($element[0].clientWidth*0.94)/1024;
    $scope.ctrlOffset = (1024*$scope.canvasScale)-50;
    $scope.ctrlStyle = "-ms-transform-origin:0% 0%; -webkit-transform-origin: 0% 0%; transform-origin: 0% 0%; -ms-transform: translate(0px,"+$scope.ctrlOffset+"px); -webkit-transform: translate(0px,"+$scope.ctrlOffset+"px); transform: translate(0px,"+$scope.ctrlOffset+"px);"
    $scope.canvasStyle = "-ms-transform-origin:0% 0%; -webkit-transform-origin: 0% 0%; transform-origin: 0% 0%; -ms-transform: scale("+$scope.canvasScale+"); -webkit-transform: scale("+$scope.canvasScale+"); transform: scale("+$scope.canvasScale+");"
    $scope.canvasHide = true;
    $scope.canvasMsg = "TAKE A PICTURE";
    $scope.photoDirty = false;
    
    $scope.listId = ggNLW.GetId();
    $scope.listTitle = ggNLW.GetTitle();
    $scope.listDesc = ggNLW.GetDesc();
    $scope.listPhoto = ggNLW.GetPhoto();
    if( $scope.listPhoto != "" ) $scope.canvasStyle += "background-image:url('"+ $scope.listPhoto+"');";
    $scope.listTheme = ggNLW.GetTheme();
    if( $scope.listTheme != "" ) $scope.activeTheme = $scope.listTheme;
    
    $scope.proStatus = ggProStatus.GetProStatus();
    
    $scope.db = openDatabase('listmas', '1.0', 'Mobile Client DB', 2 * 1024 * 1024);
    
    $scope.ShowXferModal = function(){
        mxfer.show('modal'); 
        var element = document.getElementById('xfer-input');
        if(element)
          element.focus();
    };
    
    $scope.BuyPro = function(){
        ggProStatus.BuyPro();
        mpro.hide();
    };
    
    $scope.DoDelete = function(pId, pName){
       $scope.listDeleteName = pName;
       $scope.listDeleteId = pId;
       $scope.$apply();
       modal.show('modal'); 
    };
    
    $scope.DeleteList = function () {
        
        try{
            ga('send', 'event', 'button', 'click', 'list_delete', 0);
        }catch(exception){
            console.log("ga fail");
        }
        
        console.log("Deleting List", $scope.listDeleteId);
        $scope.db.transaction(function (tx) {
            tx.executeSql('DELETE FROM tblProdlist WHERE shoplistId=?', [$scope.listDeleteId], function(tx, response){
                tx.executeSql('DELETE FROM tblShoplist WHERE shoplistId=?', [$scope.listDeleteId], function(tx, response){
                    localStorage.removeItem('activeList');
                    app.navi.resetToPage('lists.html');
                });
            });
        });
        
        return false;
    };
    
    $scope.RestoreList = function(){
        //if( ggProStatus.GetProStatus() == 1 ){
            var listpin = $scope.xferPin;
            mxfer.hide();
            $http.get('https://mylistmas.herokuapp.com/reactor/syncapi/restorelist/'+listpin).success(function(response){
            //$http.post('http://gibson.loc/listmas/reactor/syncapi/shoplist', pubData).success(function(response){
                console.log("restoring list...",response);
                console.log(response.list);
                if( response.list ){
                    $scope.db.transaction(function (tx) {
                        tx.executeSql('INSERT INTO tblShoplist (shoplistRemoteId,shoplistName,shoplistUrl,shoplistCheckoff,shoplistImage) VALUES ( ?, ?, ?, ?, ?)', 
                            [response.list.shopListId,response.list.shopListName,response.list.shopListCode,response.list.shopListCheckoff,response.list.shopListImage], 
                            function(tx, result){
                                
                                //$scope.UpdateShopList();
                                ggNLW.SetAll(result.insertId, response.list.shopListName, '', response.list.shopListImage, response.list.shopListTheme);
                                $scope.listId = ggNLW.GetId();
                                $scope.listTitle = ggNLW.GetTitle();
                                $scope.listDesc = ggNLW.GetDesc();
                                $scope.listPhoto = ggNLW.GetPhoto();
                                $scope.listTheme = ggNLW.GetTheme();
                                ggActiveList.SetActiveList(result.insertId);
                                $scope.$apply();
                                console.log("prod",response)
                                for( var idx=0; idx<response.prod.length; idx++){
                                    
                                    if( !response.prod[idx].prodDescription ) response.prod[idx].prodDescription = "";
                                    tx.executeSql('INSERT INTO tblProd (prodName, prodPhoto, prodUrl, prodUpc, prodDescription) VALUES ( ?, ?, ?, ?, ?)', 
                                        [response.prod[idx].prodName, response.prod[idx].prodPhoto, response.prod[idx].prodUrl, response.prod[idx].prodUpc, response.prod[idx].prodDescription], 
                                            function(blah){
                                                return function(tx, responseb){
                                                console.log("BLAH :P", blah);
                                                //$scope.UpdateGroceryList
                                                console.log('Inserting into prodlist: '+responseb.insertId);
                                                tx.executeSql('INSERT INTO tblProdlist (prodId, shoplistId, prodQty) VALUES ( ?, ?, ?)', 
                                                    [responseb.insertId,ggActiveList.GetActiveList(),blah], $scope.UpdateGroceryList), 
                                                    function(result, error){console.log(error);}; 
                                                };
                                            }(response.prod[idx].prodQty), function(result, error){console.log(error);});
                                    
                                    
                                }
                                //app.navi.pushPage('list.html');
                        }, function(result, error){console.log(error);});
                    });
                }else{
                    alert('Invalid transfer code. You can find this code by opening the list on the previous device.')
                }
    
            }).error(function(){
                $scope.UpdateShopList();
                alert('Something went wrong. Please try again. (3)');
            });
        //}else{
        //    mpro.show('modal'); 
        //}
    };
    
    $scope.InitPhoto = function(){
        var frameOpts = {
        	        canvas: 'picturizer',
			        width:1024,
			        height:1024,
			    };
        
        $scope.gzFrame = new GzFrame(frameOpts);
        $scope.photoDirty = false;
    };
    
    $scope.AddList = function () {
        
        ggNLW.SetTitle($scope.listTitle);
        app.navi.pushPage('nlwtheme.html');
        
    };
    
    $scope.AddDescription = function () {
        
        // Post description to service here
        ggNLW.SetDesc($scope.listDesc);
        app.navi.pushPage('nlwphoto.html');
  
    };
    
    $scope.GetPicture = function(){
        //compassData.Update();
        try{
            ga('send', 'event', 'button', 'click', 'photo_get', 0);
        }catch(exception){
            console.log("ga fail");
        }
        if( navigator.camera ){
        //if(false){
            navigator.camera.getPicture($scope.PhotoSuccess, $scope.PhotoFail, { 
                quality: 80,
                destinationType : Camera.DestinationType.FILE_URI,
                sourceType : Camera.PictureSourceType.CAMERA,
                allowEdit : false,
                encodingType: Camera.EncodingType.JPEG,
                correctOrientation: true,
      			targetWidth: 1024,
      			targetHeight: 1024,
      			saveToPhotoAlbum: false
        	    });
        }else{
            $scope.PhotoSuccess("data:image/jpeg;base64,"+$scope.dummyphoto);
        }
    };
    
    $scope.GetGallery = function(){
        //compassData.Update();
        try{
            ga('send', 'event', 'button', 'click', 'photo_get', 0);
        }catch(exception){
            console.log("ga fail");
        }
        if( navigator.camera ){
        //if(false){
            navigator.camera.getPicture($scope.PhotoSuccess, $scope.PhotoFail, { 
                quality: 80,
                destinationType : Camera.DestinationType.FILE_URI,
                sourceType : Camera.PictureSourceType.PHOTOLIBRARY,
                mediaType : Camera.MediaType.PICTURE,
                allowEdit : false,
                encodingType: Camera.EncodingType.JPEG,
                correctOrientation: true,
          		targetWidth: 1024,
      			targetHeight: 1024,
      			saveToPhotoAlbum: false
        	    });
        }else{
            $scope.PhotoSuccess("data:image/jpeg;base64,"+$scope.dummyphoto);
        }
    };
    
    $scope.PhotoSuccess = function(imageData) {

        try{
            ga('send', 'event', 'button', 'click', 'photo_set', 0);
        }catch(exception){
            console.log("ga fail");
        }
        $scope.canvasHide = false;
        //Trying the FILE_URI method
        $scope.gzFrame.SetPbImage(imageData);
        $scope.gzFrame.fstage.update();
        $scope.photoDirty = true;
        //$scope.$apply();
    };
    
    $scope.PhotoFail = function(message) {
        try{
            ga('send', 'event', 'button', 'click', 'photo_fail', 0);
        }catch(exception){
            console.log("ga fail");
        }
        console.log('Failed because: ' + message);
    };
    
    $scope.AddPhoto = function () {
        
        // Post description to service here
        if( $scope.photoDirty ){
            ggNLW.SetPhoto($scope.gzFrame.fstage.canvas.toDataURL("image/png"));
        }
        app.navi.pushPage('nlwtheme.html');
  
    };
    
    $scope.AddTheme = function (pTheme) {
        
        if( pTheme == "cabin" || pTheme == "birthday" || $scope.proStatus == 1 ){
            $scope.activeTheme=pTheme;
            ggNLW.SetTheme($scope.activeTheme);
            $scope.$apply();
        }else{
            alert('Tap the "Buy Themes" button to purchase and unlock all themes.')
        }
  
    };
    
    $scope.ImportRefresh = function() {
        app.navi.resetToPage('lists.html');
    };
    
    $scope.DoDone = function () {
        
        // Publish and set active list here
        
        ggNLW.AddUpdate().then(function(result){
            ggActiveList.SetActiveList(result);
            ggActiveList.MarkDirty();
            app.navi.resetToPage('list.html');
        }).catch(function(err){
            console.log(err);
            alert("Something went wrong. Please try again.");
        });
        
        

    };
    
}]);